import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';

const Form = () => {
  return (
  <form action="">
    <div>
    <label htmlFor="">Email:</label><input type="text" />
    </div>
    
    <label htmlFor="">Password:</label><input type="text" />
    <button onClick="" className="btn btn-primary mb-3">Submit</button>
  </form>
  )
  ;
};

export default Form;
